module.exports = {
  // newline string threshold
  printWidth: 120,

  // Set the number of spaces for each horizontal indentation of the tool
  tabWidth: 2,

  // Whether to use tab indentation
  useTabs: false,

  // Whether to add a semicolon at the end of the sentence
  semi: true,

  // use single quotes
  singleQuote: true,

  // The last object element character plus a comma
  trailingComma: 'none',

  // Whether there is a space between the curly braces of the object literal
  bracketSpacing: true,

  // jsx > Whether to take another line
  bracketSameLine: true,

  // No need to automatically add @prettier at the beginning of the file
  insertPragma: false,

  // use lf for line breaks
  endOfLine: 'lf',

  // Whether the curly braces of the object literal should start on a new line
  bracketSameLine: true,

  // Whether the arrow function parameters use parentheses
  arrowParens: 'avoid',

  // Indentation of script and style tags in vue files
  vueIndentScriptAndStyle: false,

  // Whether a single attribute is on a separate line
  singleAttributePerLine: true
};

module.exports = {
  extends: ['@commitlint/config-conventional']
};

import { FlatCompat } from '@eslint/eslintrc';
import typescriptEslint from '@typescript-eslint/eslint-plugin';
import tsParser from '@typescript-eslint/parser';
import prettier from 'eslint-plugin-prettier';
import globals from 'globals';

const { dirname } = import.meta;
const compat = new FlatCompat({
  baseDirectory: dirname
});

export default [
  {
    ignores: ['**/coverage', 'examples', '**/dist', '*.{js,mjs,cjs}', 'packages/alova/typings/serverhook.d.ts']
  },
  ...compat.extends('airbnb', 'airbnb-typescript', 'prettier'),
  {
    files: ['**/*.{js,mjs,cjs,ts,tsx}'],
    plugins: {
      '@typescript-eslint': typescriptEslint,
      prettier
    },

    languageOptions: {
      globals: {
        ...globals.browser,
        ...globals.node
      },

      parser: tsParser,
      ecmaVersion: 'latest',
      parserOptions: {
        project: './tsconfig.json',
        tsconfigRootDir: dirname
      }
    },

    rules: {
      'prettier/prettier': 'error',

      'react/function-component-definition': [
        'error',
        {
          namedComponents: ['arrow-function', 'function-declaration']
        }
      ],

      // eslint-airbnb
      'import/extensions': 'off',
      'import/no-extraneous-dependencies': 'off',
      'no-param-reassign': 'off',
      'no-restricted-syntax': 'off',
      'no-underscore-dangle': 'off',
      'import/no-mutable-exports': 'off',
      'no-nested-ternary': 'off',
      'no-multi-assign': 'off',
      'consistent-return': 'off',
      'no-restricted-exports': 'off',
      'linebreak-style': ['error', 'unix'],
      'no-unused-vars': 'off',
      'import/order': 'off',
      'import/no-relative-packages': 'off',
      'guard-for-in': 'off',
      'max-classes-per-file': 'off',
      'no-await-in-loop': 'off',
      'func-names': 'off',
      'no-empty': 'off',

      // jsx-a11y
      'jsx-a11y/aria-role': 'off',
      'react/button-has-type': 'off',
      'react/require-default-props': 'off',
      'react/react-in-jsx-scope': 'off',

      // @typescript-eslint
      '@typescript-eslint/no-explicit-any': 'off',
      '@typescript-eslint/no-unused-vars': [
        'error',
        {
          args: 'after-used',
          argsIgnorePattern: '^_',
          varsIgnorePattern: 'Unused'
        }
      ],
      '@typescript-eslint/no-empty-function': 'off',
      '@typescript-eslint/ban-ts-comment': 'off',
      '@typescript-eslint/no-var-requires': 'off',
      '@typescript-eslint/no-this-alias': 'off',
      '@typescript-eslint/no-unused-expressions': 'off',
      '@typescript-eslint/no-implied-eval': 'off',
      '@typescript-eslint/no-shadow': 'off',
      '@typescript-eslint/no-loop-func': 'off',
      '@typescript-eslint/lines-between-class-members': 'off',
      '@typescript-eslint/no-throw-literal': 'off'
    }
  }
];

{
  "extends": "./tsconfig.base.json",
  "compilerOptions": {
    "outDir": "./dist"
  },
  "include": ["internal", "scripts", "packages/**/*", "*.ts", "examples"]
}

