        "!packages/**",
        "!changeset/**",
        "!.github/**",
        "!.vscode/**",
        "!.husky/**",
        "!examples/**"
      ]
    },
    "//#format": {
      "inputs": [
        "!.git/**",
        "!node_modules/**",
        "!packages/**",
        "!changeset/**",
        "!.github/**",
        "!.vscode/**",
        "!.husky/**",
        "!examples/**"
      ]
    },
    "//#format:fix": {
      "inputs": [
        "!.git/**",
        "!node_modules/**",
        "!packages/**",
        "!changeset/**",
        "!.github/**",
        "!.vscode/**",
        "!.husky/**",
        "!examples/**"
      ]
    },
    "//#test": {
      "inputs": [
        "!.git/**",
        "!node_modules/**",
        "!packages/**",
        "!changeset/**",
        "!.github/**",
        "!.vscode/**",
        "!.husky/**",
        "!examples/**"
      ]
    },
    "build": {
      "dependsOn": ["^build"],
      "outputs": ["dist/**"]
    },
    "test": {
      "dependsOn": ["^build"]
    }
  }
}

import { resolve } from 'node:path';
import { defineProject } from 'vitest/config';

export default defineProject({
  test: {
    include: ['**/*.{test,test-d,spec,spec-d}.?(c|m)[jt]s?(x)'],
    alias: {
      '~': process.cwd(),
      '#': resolve(process.cwd(), 'test'),
      root: resolve(__dirname, 'internal'),
      '@': resolve(process.cwd(), 'src')
    },
    environment: 'jsdom',
    setupFiles: [resolve(__dirname, 'internal/vitest.setup.ts')],
    globals: true
  }
});

import { defineConfig } from 'vitest/config';

export default defineConfig({
  test: {
    coverage: {
      include: ['packages/*/src/**/*'],
      reporter: ['lcov', 'html']
    }
  }
});
